  "18640980" : "34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments:ALL STOCKS/SUPPLIES IN STORAGE CLOSETS AT CLASSROOMS & AT HALLWAY AREAS MUST BE ELEVATED OFF THE FLOOR, FOR EASY ACCESS TO CLEANING/PEST MONITORING.  The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair. \n37. TOILET ROOM DOORS SELF CLOSING: DRESSING ROOMS WITH LOCKERS PROVIDED: COMPLETE SEPARATION FROM LIVING/SLEEPING QUARTERS\nComments:BATHROOM DOOR AT THE KITCHEN AREA MUST HAVE A SELF-CLOSING DEVICE.  Toilet rooms shall be completely enclosed and shall be vented to the outside air or mechanically ventilated. \n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments:LOW WATER PRESSURE AT WATER FOUNTAINS IN THE HALLWAYS OF THE 3RD FLOOR AREA-MUST PROVIDE UNDER CITY PRESSURE.  Ventilation: All plumbing fixtures, such as toilets, sinks, washbasins, etc., must be adequately trapped, vented, and re-vented and properly connected to the sewer in accordance with the plumbing chapter of the Municipal Code of Chicago and the Rules and Regulations of the Board of Health. \n",
