  "18640980" : "32. FOOD AND NON-FOOD CONTACT SURFACES PROPERLY DESIGNED, CONSTRUCTED AND MAINTAINED\nComments:RUBBER GASKET OF CHEST FREEZER IS IN POOR REPAIR-MUST REPLACE. SOME CUTTING BOARDS IN MAIN KITCHEN HAVE DEEP GROOVES, MUST REPLACE.  All food and non-food contact equipment and utensils shall be smooth, easily cleanable, and durable, and shall be in good repair. \n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments:DUST BUILD-UP ON FAN GUARDS & CONDENSERS OF BIG & SMALL COOLERS MUST BE KEPT CLEAN.  All food and non-food contact surfaces of equipment and all food storage utensils shall be thoroughly cleaned and sanitized daily. \n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments:POOR FLOOR GROUTING UNDER THE BAR SINK (1ST FLOOR) & AT MAIN DISHROOM AREA. FLOORS AT BARS & DISHROOMS MUST BE KEPT DRY AT ALL TIMES, TO PREVENT PEST HARBORAGE.  The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair. \n35. WALLS, CEILINGS, ATTACHED EQUIPMENT CONSTRUCTED PER CODE: GOOD REPAIR, SURFACES CLEAN AND DUST-LESS CLEANING METHODS\nComments:ANY GAPS, CREVICES OR OPENINGS BETWEEN THE WALLS & BASEBOARDS IN DISHROOM & KITCHEN MUST BE SEALED.  The walls and ceilings shall be in good repair and easily cleaned. \n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments:A WATER LEAK NOTED ON CONNECTION UNDER THE 3-COMP. SINK AT MAIN DISHROOM; THE WATER LINE UNDER THE DISHMACHINE IS ESCAPING FROM THE FLOOR DRAIN- MUST EXTEND ELBOW PIPE INTO THE DRAIN.  Ventilation: All plumbing fixtures, such as toilets, sinks, washbasins, etc., must be adequately trapped, vented, and re-vented and properly connected to the sewer in accordance with the plumbing chapter of the Municipal Code of Chicago and the Rules and Regulations of the Board of Health. \n",
