  "18640980" : "18. NO EVIDENCE OF RODENT OR INSECT OUTER OPENINGS PROTECTED/RODENT PROOFED, A WRITTEN LOG SHALL BE MAINTAINED AVAILABLE TO THE INSPECTORS\nComments:OBSERVED EVIDENCE OF MORE THAN 40 MOUSE DROPPINGS SCATTERED ON FLOOR IN LIQUOR STORAGE AREA NEXT TO BEER REACH IN COOLER,WINE RACKS,UNDER CRATES STORED IN SAME AREA,ON FLOOR NEXT TO HOT WATER TANK.ALSO REAR SIDE DOOR NOT TIGHT FITTING ALONG TOP & BOTTOM OF DOOR & DOOR FRAME & BRICKS IN SAME AREA.MUST REMOVE DROPPINGS,CLEAN & SANITIZE AREAS,RODENT PROOF DOOR.RECOMMENDED TO HAVE A PEST CONTROL OPERATOR TO SERVICE PREMISES ON OR AFTER 4/30/12.(SERIOUS 7-38-020). \n30. FOOD IN ORIGINAL CONTAINER, PROPERLY LABELED: CUSTOMER ADVISORY POSTED AS NEEDED\nComments:MUST LABEL FOOD STORAGE CONTAINERS. \n32. FOOD AND NON-FOOD CONTACT SURFACES PROPERLY DESIGNED, CONSTRUCTED AND MAINTAINED\nComments:MUST REPAIR OR REPLACE WORN DOOR GASKETS ON 1ST FL. PREP COOLER. \n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments:MUST REMOVE GREASE & FOOD DEBRI FROM DEEP FRYER & GRILL TABLE,FAUCET AT 3- COMP SINK AT BAR. \n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments:MUST SEAL HOLE IN FLOOR NEAR BAR AREA.MUST CLEAN FLOOR ALONG WALL BASES THROUGHOUT. \n35. WALLS, CEILINGS, ATTACHED EQUIPMENT CONSTRUCTED PER CODE: GOOD REPAIR, SURFACES CLEAN AND DUST-LESS CLEANING METHODS\nComments:MUST SCRAPE & PAINT PEELING PAINT ON WALL IN BASEMENT & REPAIR IN SAME AREA. \n36. LIGHTING: REQUIRED MINIMUM FOOT-CANDLES OF LIGHT PROVIDED, FIXTURES SHIELDED\nComments:MUST REPAIR OR REPLACE DAMAGED & MISSING LIGHT SHIELDS AT BAR. \n40. REFRIGERATION AND METAL STEM THERMOMETERS PROVIDED AND CONSPICUOUS\nComments:MUST PROVIDE THERMOMETER FOR PREP COOLER. \n",
