  "18640980" : "21. * CERTIFIED FOOD MANAGER ON SITE WHEN POTENTIALLY HAZARDOUS FOODS ARE  PREPARED AND SERVED\nComments:(7-38-012) NO ONE ON PREMISES WITH A CITY SANITATION CERTIFICATE. MUST HAVE ONE PERSON ON SITE, WITH THIS CREDENTIALS, WHILE HANDLING, COOKING, PREPPING FOOD (LAMB, CHICKEN, BEEF).  A certified food service manager must be present in all establishments at which potentially hazardous food is prepared or served. \n29. PREVIOUS MINOR VIOLATION(S) CORRECTED 7-42-090\nComments:(7-42-090) PREVIOUS MINOR VIOLATIONS NOT CORRECTED FROM 5/24/11 VISIT. (#30-ALL FOOD IN COOLERS MUST BE DATED & LABELED; #32-STAINED CUTTING BOARD AT PREP AREA MUST BE REPLACED; CHEST FREEZER DOOR IN POOR REPAIR, MUST FIX; #33-VENTILATION FILTERS AT BOTH HOODS MUST BE CLEANED; #35-REPLACE ALL STAINED CEILING TILES & REPAIR BASEBOARD UNDER 3-COMP SINK; 40-PROVIDE INTERNAL COOLER & FOOD THERMOMETERS).   A separate and distinct offense shall be deemed to have been committed for each Minor violation that is not corrected upon re-inspection by the health authority. \n30. FOOD IN ORIGINAL CONTAINER, PROPERLY LABELED: CUSTOMER ADVISORY POSTED AS NEEDED\nComments:ALL FOODS STORED IN COOLERS THRU-OUT PREMISES MUST BE DATED, COVERED & LABELED. IF COOLING DOWN, THE START TIME OF COOLING PROCESS MUST BE INDICATED ON THE CONTAINER.  All food not stored in the original container shall be stored in properly labeled containers. \n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments:SHELVES ON BOTH SIDES OF PREP TABLES AT REAR KITCHEN, BOTTOM OF SAME TABLES & CABINETS AT FRONT PREP AREA/STEAMTABLE MUST BE KEPT CLEAN. EXTERIOR OF 3-COMP SINK NEED CLEANING ALSO.  All food and non-food contact surfaces of equipment and all food storage utensils shall be thoroughly cleaned and sanitized daily. \n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments:FLOORS UNDER ALL STORAGE SHELVINGS, BEHIND & UNDER COOKING EQUIPMENT MUST BE KEPT CLEAN ALSO.  The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair. \n35. WALLS, CEILINGS, ATTACHED EQUIPMENT CONSTRUCTED PER CODE: GOOD REPAIR, SURFACES CLEAN AND DUST-LESS CLEANING METHODS\nComments:DUSTY CEILING VENTS THRU-OUT PREMISES MUST BE CLEANED & ANY WATER-STAINED CEILING TILES MUST BE REPLACED. WALLS AROUND/UNDER PREP TABLES MUST BE KEPT CLEAN ALSO.  The walls and ceilings shall be in good repair and easily cleaned. \n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments:FOLLOWING PLUMBING ISSUES MUST BE ADDRESSED: LEAKY FAUCET AT 3-COMP SINK & AT THE COLD WATER SIDE OF REAR HANDSINK.  Ventilation: All plumbing fixtures, such as toilets, sinks, washbasins, etc., must be adequately trapped, vented, and re-vented and properly connected to the sewer in accordance with the plumbing chapter of the Municipal Code of Chicago and the Rules and Regulations of the Board of Health. \n",
