  "18640980" : "14. PREVIOUS SERIOUS VIOLATION CORRECTED, 7-42-090\nComments:A separate and distinct offense shall be deemed to have been committed for each Serious violation that is not corrected upon re-inspection by the health authority. PREVIOUS SERIOUS VIOLATION FROM REPORT #670394 ON 2/10/12 NOT CORRECTED.Previous minor violations not correccted from inspection report 634221 dated 8-9-11 #355. copy attached. #33 tops and sides of cooking equipements, vents above cooking equpments, shelves by cooking equipements, and interior and exterior of coolers,and freezers all needs detailed cleaning. #34 must clean floors, under and behind all equipement throughout the premises. #35 must clean repaint wall ceiling in kitchen area remove all food debris. #36 must clean all light shield.#41 must remove all clutter from outside storage area, clean and better organize wanted items. must correct all noted violations by 2-21-12.MUST CORRECT IN DETAIL.Continue to observe live fruit fliy activity in kitchen areas more than 6 Also rear door bottom left corner not rodent proofed. Pest control log book not provided must be on site with all required documents. must clean, sanitize all affected areas, rodent proof said door, provide a pest control log books, pestt service.CRITICAL VIOLATION (7-42-090). MUST CORRECT ALL SAID VIOLATIONS. \n43. FOOD (ICE) DISPENSING UTENSILS, WASH CLOTHS PROPERLY STORED\nComments:Between uses and during storage ice dispensing utensils and ice receptacles shall be stored in a way that protects them from contamination.Wash cloths must be properly stored in a sanitizing solution.  \n44. ONLY AUTHORIZED PERSONNEL IN THE FOOD-PREP AREA\nComments:The traffic of unnecessary persons through the food preparation and the utensil washing areas is prohibited.Only authorized personnel in the food prep area.  \n",
