  "18640980" : "2. FACILITIES TO MAINTAIN PROPER TEMPERATURE\nComments:All food establishments that display, prepare, or store potentially hazardous food shall have adequate refrigerated food storage facilities.found 2 (1) door reach in coolers not meeting temperature requirement ambient air measured (48.7-50.0f). tagged held for inspection. must not use  until repaired and notify the cdph via fax at 312 746-4240 for tag removal. critical violation 7-38-005 (A) \n3. POTENTIALLY HAZARDOUS FOOD MEETS TEMPERATURE REQUIREMENT DURING STORAGE, PREPARATION DISPLAY AND SERVICE\nComments:All hot food shall be stored at a temperature of 140F or higher. found assorted potentially hazardous foods not meeting temperature requirement held in hot holding at temperature ranging (114.1- 130.1f) manager voluntarily discarde denatured said foods. approx. 25 lbs total dollar value $140.oo  critical violation 7-38-005(A) \n18. NO EVIDENCE OF RODENT OR INSECT OUTER OPENINGS PROTECTED/RODENT PROOFED, A WRITTEN LOG SHALL BE MAINTAINED AVAILABLE TO THE INSPECTORS\nComments:All necessary control measures shall be used to effectively minimize or eliminate the presence of rodents, roaches, and other vermin and insects on the premises of all food establishments, in food-transporting vehicles, and in vending machines.  inadequate pest control found appz 15 live fruit flies on walls and ceiling at rear areas (1) live infant roach at front counter also rear door bottom left corner not rodent proofed.  Pest control log book not provided must be on site with all required document. must clean, sanitize all affeded areas, rodent proof said door, provide a pest control log books, service. serious violation (7-38-020) \n29. PREVIOUS MINOR VIOLATION(S) CORRECTED 7-42-090\nComments:A separate and distinct offense shall be deemed to have been committed for each Minor violation that is not corrected upon re-inspection by the health authority. Previous minor violations not correccted from inspection report 634221  dated 8-9-11 #355. copy attached. #33 tops and sides of cooking equipements, vents above cooking equpments, shelves by cooking equipements, and interior and exterior of coolers,and freezers all needs detailed cleaning. #34 must clean floors, under and behind all equipement throughout the premises. #35 must clean repaint wall ceiling in kitchen area remove all food debris. #36 must clean all light shield.#41 must remove all clutter from outside storage area, clean and better organize wanted items.  must correct all noted violations by 2-21-12   Serious Violation (7-42-090) \n43. FOOD (ICE) DISPENSING UTENSILS, WASH CLOTHS PROPERLY STORED\nComments:Between uses and during storage ice dispensing utensils and ice receptacles shall be stored in a way that protects them from contamination.  Wash cloths must be properly stored in a sanitizing solution. \n44. ONLY AUTHORIZED PERSONNEL IN THE FOOD-PREP AREA\nComments:The traffic of unnecessary persons through the food preparation and the utensil washing areas is prohibited. Only authorized personnel in the food prep area \n",
