  "18640980" : "13. NO EVIDENCE OF RODENT OR INSECT INFESTATION, NO BIRDS, TURTLES OR OTHER ANIMALS\nComments:All necessary control measures shall be used to effectively minimize or eliminate the presence of rodents, roaches, and other vermin/insect infestations.STILL FINDING EVIDENCE OF LIVE ROACHES MORE THAN 25 IN GASKETS OF WALK IN COOLERS,OVEN & LIVE DRAIN FLIES ON WALLS.PEST CONTROL OPERATOR ON SITE.MUST PROVIDE A CURRENT PEST CONTROL RECEIPT OF SERVICE ON OR AFTER 2/1/12. \n16. FOOD PROTECTED DURING STORAGE, PREPARATION, DISPLAY, SERVICE AND TRANSPORTATION\nComments:All food should be properly protected from contamination during storage, preparation, display, service, and transportation.STILL FINDING CALCIUM BUILD UP ON INTERIOR PART OF ICE MACHINE.MUST CLEAN. \n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments:Inspector Comments: DETAIL CLEAN ALL COOKING EQUIPMENTS IN THE PREP AREAS STOVES,OVENS,SHELVINGS THROUGHOUT INCLUDING IN SIDE THE WALK-IN-COOLERS,ROLLING CARTS INCLUDING WHEELS, INTERIOR OF ALL PREP COOLERS,PREP TABLES, WIRE STORAGE RACKS, SINKS AND TOILETS IN EMPLOYEE RESTROOMS/LOCKERS, FAN COVER IN WALK-IN COOLERS, INTERIORS OF DRAWERS AT PREP TABLES,DRY STORAGE SHELVINGS,MANUAL CAN OPENER AND HOUSING ATTACHED ALL REQUIRE A DETAIL CLEANING.  \n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments:Inspector Comments: DETAIL CLEAN FLOOR DRAINS THROUGHOUT THE PREMISES. DETAIL CLEAN FLOORS OF PREP AREAS THROUGHOUT AND LIQUOR STORAGE AREAS. ALSO SEAL ALL OPENINGS AROUND WOODEN PILLARS WERE NOTED IN FOOD PREP AREAS,DISHWASHING AREAS.FLOOR DRAINS REQUIRE A DETAIL CLEANING.NOTE:STANDING WATER IN BASEMENT AREA MUST BE REMOVED AND MAINTAINED.  \n35. WALLS, CEILINGS, ATTACHED EQUIPMENT CONSTRUCTED PER CODE: GOOD REPAIR, SURFACES CLEAN AND DUST-LESS CLEANING METHODS\nComments:Inspector Comments: OBSERVED EXCESSIVE AMOUNT OF DUST ON THE WALLS OF THE PREP AREAS AND DISHWASHING AREAS.WALLS/CEILINGS THROUGHOUT THE MENTIONED AREAS MUST BE CLEANED,SANITIZED, ALSO SEAL ALL NOTICEABLE OPENINGS ON WOODEN PILLARS, AROUND ELECTRICAL/PLUMBING FIXTURES IN KITCHEN AREAS.  \n",
