  "18640980" : "3. POTENTIALLY HAZARDOUS FOOD MEETS TEMPERATURE REQUIREMENT DURING STORAGE, PREPARATION DISPLAY AND SERVICE\nComments:All cold food shall be stored at a temperature of 40F or less.  POTENTIALLY HAZARDOUS FOODS STORED AT IMPROPER TEMPERATURES INSIDE THE WALK-IN-COOLER IN PROCESS OF COOLING METHOD.COOKED LENTIL SOUPS AT 100-140F,COOKED BEAN SOUP AT 140F,BLACK BEAN PEPPER SOUP AT 100 F(ALSO NO TIME AND TEMPERATURE LOGS PROVIDED AT THIS TIME FOR MENTIONED FOODS). ALSO COOKED CHICKEN HELD ON STORAGE SHELF AT FOOD PREP AREA IMPROPER TEMPERATURE OF 80.1F.MANAGEMENT VOLUNTARILY DISCARDED,DENATURED 10 GALLONS,5#S OF COOKED CHICKEN OF FOOD WORTH $122. CRITICAL VIOLATION 7-38-005A. \n13. NO EVIDENCE OF RODENT OR INSECT INFESTATION, NO BIRDS, TURTLES OR OTHER ANIMALS\nComments:All necessary control measures shall be used to effectively minimize or eliminate the presence of rodents, roaches, and other vermin/insect infestations.  OBSERVED AN INFESTATION OF SMALL,LARGE LIVE ROACHES INSIDE COOKING STOVES,OVENS,BOTTOM COMPARTMENTS OF DEEP FRYERS,PASTRY/BAKING AREAS,AND DEAD ROACHES OBSERVED ON SHELVINGS,RACKS,ON FLOORS INSIDE THE WALK-IN-COOLERS. OBSERVED OVER 50 LIVE FRUIT FLIES ON THE WALLS, CEILING, EQUIPMENT IN THE PREP AREAS,DISHWASHING AREAS. ADDITIONAL PEST CONTROL SERVICE IS NEEDED TO ELIMINATE THE PEST ACTIVITY. ALSO OBSERVED APPROXIMATELY OVER 100 MICE DROPPINGS IN VARIOUS AREAS OF THE CATERING OPERATION INCLUDING DISHWASHING AREAS,DRY STORAGE AREAS. MUST CLEAN AND SANITIZE AFFECTED AREAS. MUST RODENT PROOF REAR DOCK OVERHEAD DOOR 1/4' MODE OF ENTRY AT RIGHT AND LEFT CORNERS OF SAID DOOR SEAL ALL FOUNDATION WALLS IN THE BASEMENT. MUST RODENT PROOF ALL OUTER OPENINGS (DOORS) AND RODENT POISON MUST BE STORED IN A SANITARY MANNER THAT IS ENCLOSED BAIT STATIONS. CRITICAL VIOLATION 7-38-020. \n16. FOOD PROTECTED DURING STORAGE, PREPARATION, DISPLAY, SERVICE AND TRANSPORTATION\nComments:All food should be properly protected from contamination during storage, preparation, display, service, and transportation.  FOOD (ICE) NOT PROTECTED DURING STORAGE INSIDE OF THE ICE MACHINE. OBSERVED BLACK MOLD GROWTH ON INTERIOR SURFACES OF THE ICE MACHINE. MANAGEMENT INSTRUCTED TO TURN OFF MACHINE, REMOVE ICE AND HAVE INTERIOR OF ICE MACHINE CLEANED AND SANIIZED. SERIOUS VIOLATION 7-38-005A. \n30. FOOD IN ORIGINAL CONTAINER, PROPERLY LABELED: CUSTOMER ADVISORY POSTED AS NEEDED\nComments:ALL PREPARED FOODS HELD INSIDE THE COOLERS MUST BE LABELED,DATED TO IDENTIFY THE FOOD PRODUCTS STORED. \n32. FOOD AND NON-FOOD CONTACT SURFACES PROPERLY DESIGNED, CONSTRUCTED AND MAINTAINED\nComments:MUST REPLACE/REPAIR RUSTY BOTTOMS OF FOOD PREP TABLES IN KITCHEN USING A NON-TOXIC FINISH. \n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments:DETAIL CLEAN ALL COOKING EQUIPMENTS IN THE PREP AREAS STOVES,OVENS,SHELVINGS THROUGHOUT INCLUDING IN SIDE THE WALK-IN-COOLERS,ROLLING CARTS INCLUDING WHEELS, INTERIOR OF ALL PREP COOLERS,PREP TABLES, WIRE STORAGE RACKS, SINKS AND TOILETS IN EMPLOYEE RESTROOMS/LOCKERS, FAN COVER IN WALK-IN COOLERS, INTERIORS OF DRAWERS AT PREP TABLES,DRY STORAGE SHELVINGS,MANUAL CAN OPENER AND HOUSING ATTACHED ALL REQUIRE A DETAIL CLEANING. \n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments: DETAIL CLEAN FLOOR DRAINS THROUGHOUT THE PREMISES. DETAIL CLEAN FLOORS OF PREP AREAS THROUGHOUT AND LIQUOR STORAGE AREAS. ALSO SEAL ALL OPENINGS AROUND WOODEN PILLARS WERE NOTED IN FOOD PREP AREAS,DISHWASHING AREAS.FLOOR DRAINS REQUIRE A DETAIL CLEANING.NOTE:STANDING WATER IN BASEMENT AREA MUST BE REMOVED AND MAINTAINED. \n35. WALLS, CEILINGS, ATTACHED EQUIPMENT CONSTRUCTED PER CODE: GOOD REPAIR, SURFACES CLEAN AND DUST-LESS CLEANING METHODS\nComments:OBSERVED EXCESSIVE AMOUNT OF DUST ON THE WALLS OF THE PREP AREAS AND DISHWASHING AREAS.WALLS/CEILINGS THROUGHOUT THE MENTIONED AREAS MUST BE CLEANED,SANITIZED, ALSO SEAL ALL NOTICEABLE OPENINGS ON WOODEN PILLARS, AROUND ELECTRICAL/PLUMBING  FIXTURES IN KITCHEN AREAS. \n36. LIGHTING: REQUIRED MINIMUM FOOT-CANDLES OF LIGHT PROVIDED, FIXTURES SHIELDED\nComments:PROVIDE ADEQUATE LIGHTING INSIDE THE WALK IN COOLERS.REPLACE MISSING OR BROKEN LIGHT SHIELDS IN THE PREP AREAS.  \n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments:MUST REPAIR EXPOSED HANDSINK BY THE EMPLOYEES TOILET ROOMS LOOSE,COMING OFF THE WALL,REPAIR SLOW DRAINAGE AT EXPOSED HANDSINKS BY THE PASTRY/BAKING FOOD AREAS. \n41. PREMISES MAINTAINED FREE OF LITTER, UNNECESSARY ARTICLES, CLEANING  EQUIPMENT PROPERLY STORED\nComments:REMOVE UNNECESSARY ARTICLES THROUGHOUT THE PREMISES DUE TO POTENTIAL PEST HARBORAGE,BASEMENT AREAS MUST BE ORGANIZED,MAINTAINED AND REMOVE STANDING WATER AREAS. \n",
