  "18640980" : "18. NO EVIDENCE OF RODENT OR INSECT OUTER OPENINGS PROTECTED/RODENT PROOFED, A WRITTEN LOG SHALL BE MAINTAINED AVAILABLE TO THE INSPECTORS\nComments:All necessary control measures shall be used to effectively minimize or eliminate the presence of rodents, roaches, and other vermin and insects on the premises of all food establishments, in food-transporting vehicles, and in vending machines.  OBSERVED 20 FRUIT FLIES IN KITCHEN AND DISH AREAS, INSTRUCTED TO CLEAN ALL AFFECTED AREAS  SERIOUS CITATION ISSUED: 7-38-020 \n30. FOOD IN ORIGINAL CONTAINER, PROPERLY LABELED: CUSTOMER ADVISORY POSTED AS NEEDED\nComments:All food not stored in the original container shall be stored in properly labeled containers.  MUST LABEL ALL BULK STORAGE CONTAINERS \n31. CLEAN MULTI-USE UTENSILS AND SINGLE SERVICE ARTICLES PROPERLY STORED: NO REUSE OF SINGLE SERVICE ARTICLES\nComments:Containers and utensils shall be inverted, covered, or otherwise protected from contamination until used.  All single-service drinking straws and containers shall be discarded immediately after use.  MUST PROPERLY STORE MULTI-USE UTENSILS FACING UP, (SPOONS AND FORKS), MUST ALSO INVERT ALL POTS, PANS AND MULTI-USE EQUIPMENT \n32. FOOD AND NON-FOOD CONTACT SURFACES PROPERLY DESIGNED, CONSTRUCTED AND MAINTAINED\nComments:All food and non-food contact equipment and utensils shall be smooth, easily cleanable, and durable, and shall be in good repair.  MUST PROVIDE PROVIDE SNEEZE GUARD AT SERVICE AREA IN DINING ROOM TO STORE ALL CONDIMENTS UNDER, REPAIR ALL CHIPPED SHELVING AND MUST PROVIDE GASKET FOR PREP COOLER IN KITCHEN AREA \n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments:All food and non-food contact surfaces of equipment and all food storage utensils shall be thoroughly cleaned and sanitized daily.  MUST CLEAN ALL COOKING EQUIPMENT, TOPS AND SIDES, CLEAN INTERIOR OF KITCHEN CABINETS IN PREP AREAS AND BY COOKING EQUIPMENT, FOOD CARTS NEEDS DETAIL CLEANING, BULK STORAGE CONTAINERS NEEDS CLEANING CLEAN \n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments:The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair.  MUST DETAIL CLEAN FLOORS UNDER AND BEHIND ALL EQUIPMENT THROUGHOUT PREMISES, AND ALSO IN ALL STORAGE ROOMS, DETAIL CLEAN FLOOR DRAIN UNDER SINKS The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair. \n35. WALLS, CEILINGS, ATTACHED EQUIPMENT CONSTRUCTED PER CODE: GOOD REPAIR, SURFACES CLEAN AND DUST-LESS CLEANING METHODS\nComments:The walls and ceilings shall be in good repair and easily cleaned.  MUST CLEAN WALLS BY COOKING EQUIP MET, AND CEILING VENTS ABOVE PREP AREAS OF KITCHEN \n36. LIGHTING: REQUIRED MINIMUM FOOT-CANDLES OF LIGHT PROVIDED, FIXTURES SHIELDED\nComments:Shielding to protect against broken glass falling into food shall be provided for all artificial lighting sources in preparation, service, and display facilities.  MUST CLEAN ALL DUSTY LIGHT SHIELDS THROUGHOUT KITCHEN AREAS \n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments:Ventilation: All plumbing fixtures, such as toilets, sinks, washbasins, etc., must be adequately trapped, vented, and re-vented and properly connected to the sewer in accordance with the plumbing chapter of the Municipal Code of Chicago and the Rules and Regulations of the Board of Health.  MUST REPAIR ALL SLOW DRAINING EXPOSED HAND SINKS IN PREP AND DISH AREAS \n43. FOOD (ICE) DISPENSING UTENSILS, WASH CLOTHS PROPERLY STORED\nComments:Between uses and during storage ice dispensing utensils and ice receptacles shall be stored in a way that protects them from contamination.  MUST PROVIDE LABELED BUCKETS TO STORE DISH TOWELS \n",
