  "position" : 12192,
  "18640980" : "6. HANDS WASHED AND CLEANED, GOOD HYGIENIC PRACTICES;  BARE HAND CONTACT  WITH READY TO EAT FOOD MINIMIZED\nComments:All employees who handle food shall wash their hands as often as necessary to maintain a high degree of personal cleanliness and should conform to hygienic practices prescribed by the Board of Health. WE OBSERVED,POOR HYGIENIC PRACTICES,FOOD HANDLERS PERFORMING MULTIPLE TASKS(PREPARING SERVING,FOODS,CLEANING,TOUCHING DIRTY TRASH CANS,CHANGING SOILED GLOVES)AND NOT WASHING HANDS.INSTRUCTED  MANAGER ON PROPER PROCEDURES OF WASHING HANDS PER CITY CODE.CRITICAL CITATION ISSUED 7-38-010(A). \n18. NO EVIDENCE OF RODENT OR INSECT OUTER OPENINGS PROTECTED/RODENT PROOFED, A WRITTEN LOG SHALL BE MAINTAINED AVAILABLE TO THE INSPECTORS\nComments:All necessary control measures shall be used to effectively minimize or eliminate the presence of rodents, roaches, and other vermin and insects on the premises of all food establishments, in food-transporting vehicles, and in vending machines.  OBSERVED LIVE FRUIT FLIES ON THE PREMISES AND IMPROPER PEST CONTROL METHODS. APPROXIMATELY 45 LIVE FRUIT FLIES WERE OBSERVED ON THE WALLS/CEILINGS OF THE CULINARY CLASSROOMS #340,#320-A,#320- B,#317,#333 AND SOUTH DOOR 1ST FLOOR NOT INSECT/RODENT PROOFED ALSO OVERHEAD DOCK DOOR MUST BE TIGHT FITTING ALL ACCROSS THE BOTTOMS.MUST CLEAN,SANITIZE ALL AFFECTED AREAS,RODENT PROOF MENTIONED DOORS, ADDITIONAL PEST CONTROL SERVICE IS NEEDED TO MINIMIZE OR ELIMINATE THE PEST ACTIVITY. SERIOUS VIOLATION 7-38-020.  \n31. CLEAN MULTI-USE UTENSILS AND SINGLE SERVICE ARTICLES PROPERLY STORED: NO REUSE OF SINGLE SERVICE ARTICLES\nComments:Containers and utensils shall be inverted, covered, or otherwise protected from contamination until used.  All single-service drinking straws and containers shall be discarded immediately after use.AT THE DEVOS KITCHEN #128,GARDE MANAGER KITCHEN #330,CHOCOLATE &SUGAR KITCHEN #317,KRAFT KITCHEN #333-MUST PROPERLY STORE,INVERT CLEAN MULTI-USE POTS/PANS/DISHWARE TO PREVENT CONTAMINATION BEFORE USE. \n32. FOOD AND NON-FOOD CONTACT SURFACES PROPERLY DESIGNED, CONSTRUCTED AND MAINTAINED\nComments:All food and non-food contact equipment and utensils shall be smooth, easily cleanable, and durable, and shall be in good repair.  MUST DEFROST THE WALK- IN- FREEZER IN STORE ROOM#112. AT LAB KITCHEN #120A MUST RECAULK THE SURFACE ABOVE THE 3 COMPARTMENT SINK AREAS. AT DEVOS KITCHEN #128 MUST REPLACE WORNED OUT CUTTING BOARDS. AT KRAFT R&D KITCHEN#333 MUST RESEAL THE SPLASHGUARD AT EXPOSED HANDSINK.  \n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments:All food and non-food contact surfaces of equipment and all food storage utensils shall be thoroughly cleaned and sanitized daily.  AT STORE ROOM #112,LAB KITCHEN #120A,CLASSROOM#340 SHELVINGS,FAN COVERS INSIDE THE WALK-IN-COOLERS,DRY STORAGE CAGED SHELVINGS,INTERIOR BASINS OF THE 3 COMP SINK REQUIRE A DETAIL CLEANING. AT DEVOS KITCHEN #128 MUST CLEAN THE INTERIOR/EXTERIORS OF COOKING EQUIPMENTS. AT KRAFT R&D KITCHEN #333 MANUAL CAN OPENER AND HOUSING ATTACHED REQUIRES A DETAIL CLEANING AND GARDE MANAGER KITCHEN #330 MUST  DETAIL CLEAN HANGING RACKS DUST ACCUMULATIONS.CHOCOLATE & SUGAR KITCHEN#317 MUST DETAIL CLEAN THE COOKING EQUIPMENT,COOLERS,ROLLING UTILITY CARTS,STORAGE CABINETS,HOT HOLDING UNIT. \n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments:The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair.  DETAIL CLEAN THE FLOORS IN THE STORE ROOM#112 BENEATH THE ICE BLOCK MACHINE,REMOVE STANDING WATER,BOILER ROOM SAME AREA. ALSO DETAIL CLEAN THE FLOORS,FLOOR DRAINS IN THE CHOCOLATE &SUGAR KITCHEN#317. AT LAB KITCHEN#120A,#120B, MUST DETAIL CLEAN THE FLOORS BEHIND AND AROUND THE DISHMACHINES AT THE 3 COMPARTMENT SINK AND REMOVE STANDING WATER.FLOORS IN THE UTILITY MOP SINK AREAS,ELECTRICAL ROOMS,1ST FLOOR DOCK AREAS REQUIRE A DETAIL CLEANING.   \n35. WALLS, CEILINGS, ATTACHED EQUIPMENT CONSTRUCTED PER CODE: GOOD REPAIR, SURFACES CLEAN AND DUST-LESS CLEANING METHODS\nComments:The walls and ceilings shall be in good repair and easily cleaned.   MUST REMOVE DUSTS ACCUMULATIONS ON VENTILATION COVERS IN THE STORE ROOM#112,CHOCOLATE & SUGAR KITCHEN 317,AT GARDE MANAGER KITCHEN #330,CLASSROOM#320B,CLASSROOM#340 UPPER WALLS NEED CLEANING.ALSO SOME SECTIONS OF WALLS IN REAR HALLWAY DOCK CORRIDOR NEED REPAIR,REMOVE PEELING PAINT ON WALLS IN THE MOP SINK ROOM AT LAB KITCHEN #120B AREA.DETAIL WALLS IN BETWEEN FIRE DOORS REMOVE DUSTS IN THE KRAFT #333.MUST PROVIDE SECTION OF CEILING TILE IN THE DEVOS KITCHEN #128. \n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments:Ventilation: All plumbing fixtures, such as toilets, sinks, washbasins, etc., must be adequately trapped, vented, and re-vented and properly connected to the sewer in accordance with the plumbing chapter of the Municipal Code of Chicago and the Rules and Regulations of the Board of Health.  IN THE CHOCOLATE & SUGAR KITCHEN #317 MUST REPAIR/REPLACE SPRAYER AT THE 3 COMP SINK AREA.AT THE LAB KITCHEN #120A,MUST REPAIR WATER LEAKING AT FAUCET 3 COMP SINK AREA. \n40. REFRIGERATION AND METAL STEM THERMOMETERS PROVIDED AND CONSPICUOUS\nComments:All food establishments that display, prepare, or store potentially hazardous foods shall have calibrated metal stem thermometers, provided and conspicuous, for refrigerated and hot food units.  MUST PROVIDE MISSING THERMOMETERS,MAINTAIN INSIDE ALL REFRIGERATION UNITS WERE NOTED. \n41. PREMISES MAINTAINED FREE OF LITTER, UNNECESSARY ARTICLES, CLEANING  EQUIPMENT PROPERLY STORED\nComments:All parts of the food establishment and all parts of the property used in connection with the operation of the establishment shall be kept neat and clean and should not produce any offensive odors.  MUST REMOVE BAKING SHEET PANS COVERING WINDOWS IN THE CHOCOLATE & SUGAR KITCHEN#317.REMOVE PERSONAL BELONGINGS (SHOES) FROM CLASSROOM#320 A. \n",
