  "18640980" : "16. FOOD PROTECTED DURING STORAGE, PREPARATION, DISPLAY, SERVICE AND TRANSPORTATION\nComments:All food should be properly protected from contamination during storage, preparation, display, service, and transportation.  SOURCE OF CROSS CONTAMINATION, INTERIOR OF ICE MACHINE, TOP AREA OF MACHINE AND INTERIOR PANELS, APPEARS TO HAVE MOLD BUILD-UP, NOT CLEAN, INSTRUCTED TO DISCONTINUE USE, AND USE PRE PACKAGE ICE, UNTIL MACHINE IS CLEAN, MACHINE TAGGED, INSTRUCTED TO FAX A LETTER TO CDPH ONCE MACHINE IS PROPERLY CLEAN AND SANITIZE, FAX #312746-4240   SERIOUS CITATION ISSUED: 7-38-005 (A) \n31. CLEAN MULTI-USE UTENSILS AND SINGLE SERVICE ARTICLES PROPERLY STORED: NO REUSE OF SINGLE SERVICE ARTICLES\nComments:Containers and utensils shall be inverted, covered, or otherwise protected from contamination until used.  All single-service drinking straws and containers shall be discarded immediately after use.  MUST INVERT ALL MULTI USE UTENSIL, FLAT WARE, POTS, AND PANS TO PROTECT FROM CONTAMINATION   \n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments:All food and non-food contact surfaces of equipment and all food storage utensils shall be thoroughly cleaned and sanitized daily.  MUST CLEAN INTERIOR CABINETS UNDER COUNTER AREA BY STORAGE ROOM \n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments:The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair.  FLOORS IN STORAGE AREA NEEDS DETAIL CLEANING \n35. WALLS, CEILINGS, ATTACHED EQUIPMENT CONSTRUCTED PER CODE: GOOD REPAIR, SURFACES CLEAN AND DUST-LESS CLEANING METHODS\nComments:The walls and ceilings shall be in good repair and easily cleaned.  MUST REMOVE ALL DUST FROM CEILING PREP AREA KITCHEN \n36. LIGHTING: REQUIRED MINIMUM FOOT-CANDLES OF LIGHT PROVIDED, FIXTURES SHIELDED\nComments:Shielding to protect against broken glass falling into food shall be provided for all artificial lighting sources in preparation, service, and display facilities.  LIGHT SHIELDS NEEDS DETAILED CLEANING IN PREP AREA \n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments:Ventilation: All plumbing fixtures, such as toilets, sinks, washbasins, etc., must be adequately trapped, vented, and re-vented and properly connected to the sewer in accordance with the plumbing chapter of the Municipal Code of Chicago and the Rules and Regulations of the Board of Health.  MUST REPAIR SLOW DRAINING HAND SINKS IN KITCHEN PREP AREA \n40. REFRIGERATION AND METAL STEM THERMOMETERS PROVIDED AND CONSPICUOUS\nComments:All food establishments that display, prepare, or store potentially hazardous foods shall have calibrated metal stem thermometers, provided and conspicuous, for refrigerated and hot food units.  MUST PROVIDE THERMOMETERS INSIDE ALL COOLERS AND FREEZERS \n43. FOOD (ICE) DISPENSING UTENSILS, WASH CLOTHS PROPERLY STORED\nComments:Between uses and during storage ice dispensing utensils and ice receptacles shall be stored in a way that protects them from contamination.  MUST PROVIDE A BUCKET FOR ICE SCOOP, RESTRICT STORING ON WALL \n",
