  "18640980" : "16. FOOD PROTECTED DURING STORAGE, PREPARATION, DISPLAY, SERVICE AND TRANSPORTATION\nComments: All food should be properly protected from contamination during storage, preparation, display, service, and transportation. SOURCE OF CROSS CONTAMINATION, INTERIOR OF ICE MACHINE, TOP AREA OF MACHINE AND INTERIOR PANELS, HAS MOLD BUILD-UP, NOT CLEAN, CONDENSATION FROM SLIMY AREAS DRIPPING ONTO ICE USED FOR CONSUMPTION. INSTRUCTED TO DISCONTINUE USE, AND USE PRE PACKAGE ICE, UNTIL MACHINE IS CLEANED AND SANITIZED. MACHINE TAGGED, INSTRUCTED TO FAX A LETTER TO CDPH ONCE MACHINE IS PROPERLY CLEAN AND SANITIZE, FAX #312-746-4240 CRITICAL CITATION ISSUED: 7-38-005 (A)\n29. PREVIOUS MINOR VIOLATION(S) CORRECTED 7-42-090\nComments: A separate and distinct offense shall be deemed to have been committed for each Minor violation that is not corrected upon re-inspection by the health authority. CONTINUED NON-COMPLIANCE ON PREVIOUS MINOR VIOLATIONS NOTED, 1/6/2010, FOR VIOLATIONS #'S, 33, 34, 35, 38, AND 41, SEE ATTACHED REPORT, #1332477, SERIUOS CITATION ISSUED: 7-42-090",
