  "18640980" : "33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments: All food and non-food contact surfaces of equipment and all food storage utensils shall be thoroughly cleaned and sanitized daily. MUST CLEAN EXTERIOR OF ALL COOLERS AND FREEZERS, COUNTER TABLE TOP, INTERIOR AND EXTERIOR OF ALL COOKING EQUIPMENT, AND BASE OF TOILET COMMODE\n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments: The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair. MUST DETAIL CLEAN FLOORS UNDER AND BEHIND ALL EQUIPMENT, FIRST FLOOR AND BASEMENT AREAS\n35. WALLS, CEILINGS, ATTACHED EQUIPMENT CONSTRUCTED PER CODE: GOOD REPAIR, SURFACES CLEAN AND DUST-LESS CLEANING METHODS\nComments: The walls and ceilings shall be in good repair and easily cleaned. WALLS/CEILING NEEDS DETAILING/REPAINTING KITCHEN AREA\n36. LIGHTING: REQUIRED MINIMUM FOOT-CANDLES OF LIGHT PROVIDED, FIXTURES SHIELDED\nComments: All rooms in which food or drink is prepared, or in which utensils are washed, shall be lighted so that a minimum of 50-foot candles of light is available on all work surfaces. MUST INCREASE LIGHT IN KITCHEN PREP AREA\n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments: Ventilation: All plumbing fixtures, such as toilets, sinks, washbasins, etc., must be adequately trapped, vented, and re-vented and properly connected to the sewer in accordance with the plumbing chapter of the Municipal Code of Chicago and the Rules and Regulations of the Board of Health. MUST PROVIDE THREE SINK STOPPERS FOR THREE COMPARTMENT SINK, AND MOVE OVEN DIRECTLY UNDER EXHAUST SYSTEM\n40. REFRIGERATION AND METAL STEM THERMOMETERS PROVIDED AND CONSPICUOUS\nComments: All food establishments that display, prepare, or store potentially hazardous foods shall have calibrated metal stem thermometers, provided and conspicuous, for refrigerated and hot food units. MUST PROVIDE INTERIOR THERMOMETERS FOR ALL COOLERS",
