  "18640980" : "30. FOOD IN ORIGINAL CONTAINER, PROPERLY LABELED: CUSTOMER ADVISORY POSTED AS NEEDED\nComments: All food not stored in the original container shall be stored in properly labeled containers. MUST LABEL ALL BULK STORAGE CONTAINERS, STORED IN BASEMENT AREA\n32. FOOD AND NON-FOOD CONTACT SURFACES PROPERLY DESIGNED, CONSTRUCTED AND MAINTAINED\nComments: All food and non-food contact equipment and utensils shall be smooth, easily cleanable, and durable, and shall be in good repair. MUST PROVIDE A SPLASH GUARD AT REAR KITCHEN EXPOSED HAND BOWL, BETWEEN COUNTER AND GRILL AREA, AT FRONT BAR AREA BETWEEN 3 COMPARTMENT SINK AND EXPOSED HAND BOWL\n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments: All food and non-food contact surfaces of equipment and all food storage utensils shall be thoroughly cleaned and sanitized daily. MUST CLEAN VENTS ABOVE COOKING EQUIPMENT, INTERIOR PANEL OF ICE MACHINE, TOPS, SIDE AND INTERIOR CABINETS OF COOKING EQUIPMENT, AND INTERIOR OF COOLERS AND FREEZERS, ALL NEEDS DETAIL CLEANING\n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments: The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair. MUST DETAIL CLEAN FLOORS UNDER AND BEHIND ALL EQUIPMENT THROUGHOUT PREMISES\n36. LIGHTING: REQUIRED MINIMUM FOOT-CANDLES OF LIGHT PROVIDED, FIXTURES SHIELDED\nComments: All rooms in which food or drink is prepared, or in which utensils are washed, shall be lighted so that a minimum of 50-foot candles of light is available on all work surfaces. MUST PROVIDE LIGHT INSIDE REACH-IN COOLERS\n37. TOILET ROOM DOORS SELF CLOSING: DRESSING ROOMS WITH LOCKERS PROVIDED: COMPLETE SEPARATION FROM LIVING/SLEEPING QUARTERS\nComments: MUST STORE EMPLOYEES BELONGINGS ONE DESIGNATED AREA, NICE AND NEATLY\n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments: Ventilation: All plumbing fixtures, such as toilets, sinks, washbasins, etc., must be adequately trapped, vented, and re-vented and properly connected to the sewer in accordance with the plumbing chapter of the Municipal Code of Chicago and the Rules and Regulations of the Board of Health. MUST PROVIDE THREE SINK STOPPERS FOR THREE COMPARTMENT, AND PROVIDE KILOWATTS TO OVEN THATS NOT UNDER EXHAUST HOOD, OR STORE OVEN UNDER EXHAUST HOOD\n40. REFRIGERATION AND METAL STEM THERMOMETERS PROVIDED AND CONSPICUOUS\nComments: All food establishments that display, prepare, or store potentially hazardous foods shall have calibrated metal stem thermometers, provided and conspicuous, for refrigerated and hot food units. MUST PROVIDE THERMOMETERS INSIDE ALL COOLERS\n41. PREMISES MAINTAINED FREE OF LITTER, UNNECESSARY ARTICLES, CLEANING EQUIPMENT PROPERLY STORED\nComments: All parts of the food establishment and all parts of the property used in connection with the operation of the establishment shall be kept neat and clean and should not produce any offensive odors. MUST CLEAN ALL STORAGE CLOSETS, REMOVE ALL CLUTTER AND BETTER MAINTAIN",
