  "position" : 16159,
  "18640980" : "4. SOURCE OF CROSS CONTAMINATION CONTROLLED I.E. CUTTING BOARDS, FOOD HANDLERS, UTENSILS, ETC\nComments: All food shall be protected from contamination and the elements, and so shall all food equipment, containers, utensils, food contact surfaces and devices, and vehicles. SOURCE OF CROSS CONTAMINATION, INTERIOR OF ICE MACHINE, TOP AREA OF MACHINE AND INTERIOR PANELS, APPEARS TO HAVE MOLD BUILD-UP, NOT CLEAN, INSTRUCTED TO DISCONTINUE USE, AND USE PRE PACKAGE ICE, UNTIL MACHINE IS CLEAN, MACHINE TAGGED, INSTRUCTED TO FAX A LETTER TO CDPH ONCE MACHINE IS PROPERLY CLEAN AND SANITIZE, FAX #312746-4240 CRITICAL CITATION ISSUED: 7-38-005(A)\n24. DISH WASHING FACILITIES: PROPERLY DESIGNED, CONSTRUCTED, MAINTAINED, INSTALLED, LOCATED AND OPERATED\nComments: All dishwashing machines must be of a type that complies with all requirements of the plumbing section of the Municipal Code of Chicago and Rules and Regulation of the Board of Health. THREE COMPARTMENT SINK IN POOR REPAIR, WASTE WATER BACK-UP, AT ALL COMPARTMENTS, WATER NOT PROPERLY DRAINING, INSTRUCTED TO REPAIR SERIOUS CITATION ISSUED: 7-38-030\n32. FOOD AND NON-FOOD CONTACT SURFACES PROPERLY DESIGNED, CONSTRUCTED AND MAINTAINED\nComments: All food and non-food contact equipment and utensils shall be smooth, easily cleanable, and durable, and shall be in good repair. MUST REMOVE ALL CARDBOARDS FROM STORAGE SHELVING, REPAINT ALL RAW WOOD SHELVING, AND REPLACE BADLY PITTED CUTTING BOARDS AT PREP STATION\n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments: All food and non-food contact surfaces of equipment and all food storage utensils shall be thoroughly cleaned and sanitized daily. MUST DETAIL CLEAN ALL KITCHEN EQUIPMENTS COOLERS, OVENS, FOOD PREP TABLES, SHELVINGS,BEHIND FRONT SERVICE COUNTERS REQUIRE DETAIL CLEANING\n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments: The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair. FLOORS BEHIND-UNDER-AROUND HEAVY EQUIPMENTS IN NEED OF DETAIL CLEANING, ESPECIALLY IN DRY STORAGE AREAS, AND ON 2ND FLOOR\n38. VENTILATION: ROOMS AND EQUIPMENT VENTED AS REQUIRED: PLUMBING: INSTALLED AND MAINTAINED\nComments: Ventilation: All plumbing fixtures, such as toilets, sinks, washbasins, etc., must be adequately trapped, vented, and re-vented and properly connected to the sewer in accordance with the plumbing chapter of the Municipal Code of Chicago and the Rules and Regulations of the Board of Health. MUST REPAIR BROKEN HANDLE TO WOMENS TOILET COMMODE, ADDITION TOILET NEAR BY MUST PROVIDE THE KILOWATTS TO CREPES COOKING EQUIPMENT\n41. PREMISES MAINTAINED FREE OF LITTER, UNNECESSARY ARTICLES, CLEANING EQUIPMENT PROPERLY STORED\nComments: All parts of the food establishment and all parts of the property used in connection with the operation of the establishment shall be kept neat and clean and should not produce any offensive odors. MUST REMOVE CLUTTER 2ND FLOOR STORAGE AREA, CLEAN AND BETTER ORGANIZE ALL AREAS",
