  "position" : 16377,
  "18640980" : "3. POTENTIALLY HAZARDOUS FOOD MEETS TEMPERATURE REQUIREMENT DURING STORAGE, PREPARATION DISPLAY AND SERVICE\nComments: All cold food shall be stored at a temperature of 40F or less. OBSERVED POTENTIALLY HAZARDOUS FOODS STORED AT IMPROPER TEMEPRATURE IN BUS TUBS WITH SOME ICE AROUND THE FOOD. OBSERVED COOKED CHICKEN AT 50F, FETA CHEESE AT 48F, PARMESAN CHEESE AT 52F, BLUE CHEESE AT 45F, PROVOLONE CHEESE AT 47F, SWISS CHEESE AT 48F, TOMATO SOUP AT 75F, CHICKEN SALAD AT 44F, TUNA SALAD AT 46F. MANAGEMENT VOLUNTARILY DISCARDED 25# OF FOOD WORTH $93. CRITICAL VIOLATION 7-38-005A.\n33. FOOD AND NON-FOOD CONTACT EQUIPMENT UTENSILS CLEAN, FREE OF ABRASIVE DETERGENTS\nComments: All food and non-food contact surfaces of equipment and all food storage utensils shall be thoroughly cleaned and sanitized daily. DETAIL CLEAN THE SYRUP BOTTLES AND NOZZLES, INTERIOR OF STORAGE CABINETS BELOW THE COUNTER.\n34. FLOORS: CONSTRUCTED PER CODE, CLEANED, GOOD REPAIR, COVERING INSTALLED, DUST-LESS CLEANING METHODS USED\nComments: The floors shall be constructed per code, be smooth and easily cleaned, and be kept clean and in good repair. DETAIL CLEAN THE FLOOR OF THE STORAGE CLOSET.\n40. REFRIGERATION AND METAL STEM THERMOMETERS PROVIDED AND CONSPICUOUS\nComments: All food establishments that display, prepare, or store potentially hazardous foods shall have calibrated metal stem thermometers, provided and conspicuous, for refrigerated and hot food units. REPLACE THE BROKEN REFRIGERATION THERMOMETER IN COOLER #4.",
